INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('e6f8c856-5c0b-4b8d-a503-2ee3f5cf8d3d', '9771442058', N'Hārī Būtar wa-muqaddasāt al-mawt', '2008', N'Nahḍat Miṣr', N'Arabic', '599', 'https://openlibrary.org/images/icons/avatar_book.png', N'<p>Burdened with the dark, dangerous, and seemingly impossible task of locating and destroying Voldemort''s remaining Horcruxes, Harry, feeling alone and uncertain about his future, struggles to find the inner strength he needs to follow the path set out before him.</p>');
