INSERT INTO [books] ([id], title, [image_url], [description]) VALUES ('7d5f7e87-bac8-4409-a908-86e0a3a7c609', N'Harry Potter and the Goblet of Fire', 'https://covers.openlibrary.org/w/id/13949036-L.jpg', N'');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('4cd8e8e7-a71a-4f7a-ab51-0a811f43309c', '8650523242', N'Upražnjeno mesto', '2012', N'Evro-Giunti', N'Serbian', '471', 'https://covers.openlibrary.org/b/id/13019112-L.jpg', N'<p>When Barry Fairbrother dies unexpectedly in his early forties, the little town of Pagford is left in shock. Pagford is, seemingly, an English idyll, with a cobbled market square and an ancient abbey, but what lies behind the pretty façade is a town at war. Rich at war with poor, teenagers at war with their parents, wives at war with their husbands, teachers at war with their pupils…. Pagford is not what it first seems. And the empty seat left by Barry on the town’s council soon becomes the catalyst for the biggest war the town has yet seen. Who will triumph in an election fraught with passion, duplicity and unexpected revelations? Blackly comic, thought-provoking and constantly surprising, The Casual Vacancy is J.K. Rowling’s first novel for adults.</p>');
