INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('542dbc4b-ec05-4d80-8642-ca5b835823c7', '3551558310', N'Harry Potter und der Stein der Weisen : MinaLima-Ausgabe', '2021', N'Carlsen Verlag GmbH', N'German', '368', 'https://covers.openlibrary.org/b/id/12366185-L.jpg', N'<p>Bisher war das Leben von Harry Potter nicht gerade voller Magie. Er lebt bei den furchtbaren Dursleys im Ligusterweg 4, sein Zimmer ist der Schrank unter der Treppe und eine Geburtstagfeier hatte er seit zehn Jahren nicht. Doch dann erhält er per Eulenpost einen mysteriösen Brief. Er soll sich an der Hogwarts-Schule für Hexerei und Zauberei einfinden! Dort bekommt er nicht nur Unterricht in den erstaunlichsten Fächern, er findet auch Freunde fürs Leben. Gemeinsam mit ihnen stürzt er von einem Abenteuer ins nächste. Doch es wartet auch eine schicksalshafte Begegnung auf ihn, die sein Leben für immer verändern wird …</p>');
