INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('aeb3f01e-ec3e-4a31-9459-2b8d54c328fb', '9750803310', N'Harry Potter ve Ateş Kadehi', '2001', N'YKY', N'Turkish', '859', 'https://covers.openlibrary.org/b/id/13667609-L.jpg', N'<p>Harry Potter''ın büyücülük okulundaki dördüncü yılında başından geçenleri anlatan Harry Potter ve Ateş Kadehi, dizinin önceki kitaplarında tanık olduğumuzdan hem çok daha eğlenceli, hem çok daha ürkütücü bir büyücülük dünyasının kapılarını açıyor.</p><p>Hogwarts Cadılık ve Büyücülük Okulu''nda dördüncü sınıfa geçen Harry, yaz tatilinde Dursley''lerden izin koparıp arkadaşlarıyla birlikte Quidditch Dünya Kupası finalini izlemeye gidiyor. Bu yıl Hogwarts''taki en büyük yenilik ise, Üçbüyücü Turnuvası. Üç rakip büyücülük okulunun katılımıyla gerçekleşen bu etkinlik yüz yıldan beri ilk kez düzenleniyor. Harry, istemediği halde, yaşı bile tutmadığı halde, kendini bu Turnuva''nın içinde buluyor. Oysa onun tek istediği, büyücülük standartları içinde olabildiğince "normal" bir yaşam sürmek, yeni büyüler öğrenerek kendini geliştirmek, Cho''yla ilgili hayaller kurmak, Ron ve Hermione''yle hoşça vakit geçirmek. Ancak, alnındaki yara izinin ikide bir acıması, korkunç olayların yaklaşmakta olduğunun habercisi...</p><p>Harry Potter ve Ateş Kadehi, dizinin önceki kitaplarında tanık olduğumuzdan hem çok daha eğlenceli, hem çok daha ürkütücü bir büyücülük dünyasının kapılarını açıyor. J. K. Rowling, 7 cilt olarak planladığı Harry Potter dizisinin ilk kitabı Harry Potter ve Felsefe Taşı (YKY, 2001), ikinci kitabı Harry Potter ve Sırlar Odası (YKY, 2001), üçüncü kitabı Harry Potter ve Azkaban Tutsağı''ndan (YKY, 2001) sonra, bir kez daha Türk okuruyla buluşuyor.</p>');
