INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [image_url], [description]) VALUES ('9b211b4b-85d5-4fa4-bb04-e587a88af0e1', '0747574510', N'Harry Potter''s School Book Pack', '2004', N'BLOOMSBURY CHILDREN''', 'https://covers.openlibrary.org/b/id/488308-L.jpg', N'<p>This a collection of two schoolbooks of Harry Potter studying at Hogwarts. Quidditch through the ages gives the historical account of the famous wizard sport, Quidditch and Fantastic Beasts and where to find them is like the dictionary of all the different species of magical beasts or animal beings.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages], [image_url], [description]) VALUES ('5c608023-8af0-4c76-937c-96bc95be1e15', '0316206873', N'The silkworm', '2014', N'English', '455', 'https://covers.openlibrary.org/b/id/11416661-L.jpg', N'<p>When novelist Owen Quine goes missing, his wife calls in private detective Cormoran Strike. At first, Mrs. Quine just thinks her husband has gone off by himself for a few days--as he has done before--and she wants Strike to find him and bring him home. But as Strike investigates, it becomes clear that there is more to Quine''s disappearance than his wife realizes. The novelist has just completed a manuscript featuring poisonous pen-portraits of almost everyone he knows. If the novel were to be published, it would ruin lives--meaning that there are a lot of people who might want him silenced. When Quine is found brutally murdered under bizarre circumstances, it becomes a race against time to understand the motivation of a ruthless killer, a killer unlike any Strike has encountered before.</p>');
