INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('ff28758a-f925-4f82-a346-8e668c9f539c', '0747581088', N'Harry Potter and the Half-blood Prince', '2005', N'Bloomsbury', N'Latin', '607', 'https://covers.openlibrary.org/b/id/10716273-L.jpg', N'<p>It is the middle of the summer, but there is an unseasonal mist pressing against the windowpanes. Harry Potter is waiting nervously in his bedroom at the Dursleys'' house in Privet Drive for a visit from Professor Dumbledore himself. One of the last times he saw the Headmaster was in a fierce one-to-one duel with Lord Voldemort, and Harry can''t quite believe that Professor Dumbledore will actually appear at the Dursleys'' of all places. Why is the Professor coming to visit him now? What is it that cannot wait until Harry returns to Hogwarts in a few weeks'' time? Harry''s sixth year at Hogwarts has already got off to an unusual start, as the worlds of Muggle and magic start to intertwine...   --back cover
