INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [number_of_pages], [image_url], [description]) VALUES ('69f55b56-62c3-44af-ba6a-58c4cf041fa8', '3551557411', N'Harry Potter 1 und der Stein der Weisen', '2018', N'Carlsen Verlag GmbH', '336', 'https://covers.openlibrary.org/b/id/10565554-L.jpg', N'<p>Bis zu seinem elften Geburtstag glaubt Harry, er sei ein ganz normaler Junge. Doch dann erfährt er, dass er sich an der Schule für Hexerei und Zauberei einfinden soll – denn er ist ein Zauberer! In Hogwarts stürzt Harry von einem Abenteuer ins nächste und muss gegen Bestien, Mitschüler und Fabelwesen kämpfen. Da ist es gut, dass er schon Freunde gefunden hat, die ihm im Kampf gegen die dunklen Mächte zur Seite stehen.</p>');
