INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('2c75f6df-fbb8-446a-93eb-d7bfc704cef1', '9573323575', N'哈利波特 ─ 死神的聖物 2/2', '2007', N'Huang guan wen hua chu ban you xian gong si', N'Chinese', '862', 'https://covers.openlibrary.org/b/id/8248424-L.jpg', N'<p>被魔法部長昆爵扣留的鄧不利多遺物，在他死後一個月，終於交到了哈利、妙麗和榮恩的手上。但是為什麼鄧不利多要留下這些東西給他們？這三樣東西可以幫助哈利摧毀佛地魔的分靈體嗎？而被扣留的第四樣遺物──高錐客‧葛來分多的寶劍，又流落何方？   這一切讓哈利感到困惑：難道去年他跟鄧不利多的多次長談中，他錯過了什麼？鄧不利多是否期待他應該會懂？
