INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('d9bd9fc8-7b46-48fa-9bad-c7dbd24ce1d5', '1338263897', N'Fantastic Beasts: The Crimes of Grindelwald', '2018', N'Arthur A. Levine Books', N'English', '287', 'https://covers.openlibrary.org/b/id/8282856-L.jpg', N'<p>The powerful Dark wizard Gellert Grindelwald has been captured in New York with the help of Newt Scamander. But, making good on his threat, Grindelwald escapes custody and sets about gathering followers, most unsuspecting of his true agenda: to raise up pure-blood wizards to rule over all non-magical beings. In an effort to thwart Grindelwald''s plans, Albus Dumbledore enlists Newt, his former Hogwarts student, who agrees to help once again, unaware of the dangers that lie ahead. Lines are drawn as love and loyalty are tested, even among the truest friends and family, in an increasingly divided wizarding world.</p><p>Fantastic Beasts: The Crimes of Grindelwald is the second screenplay in the five-film series to be written by J.K. Rowling, author of the internationally best-selling Harry Potter books. Set in 1927, a few months after the events of Fantastic Beasts and Where to Find Them, and moving from New York to London, Paris, and even back to Hogwarts, this story of mystery and magic reveals an extraordinary new chapter in the wizarding world.</p><p>This description comes from the publisher. Fantastic Beasts: The Crimes of Grindelwald is the second book in the Fantastic Beasts series, the first of which is Fantastic Beasts and Where to Find Them. It is also part of the Harry Potter series, the first of which is published as both Harry Potter and the Philosopher''s Stone and Harry Potter and the Sorcerer''s Stone.</p>');
