INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('7f769084-699e-44e3-8089-a78cc47bdfaf', '1408810557', N'Harry Potter and the Chamber of Secrets', '2010', N'Bloomsbury', N'English', '251', 'https://covers.openlibrary.org/b/id/12630813-L.jpg', N'<p>Harry Potter is a wizard. He is in his second year at Hogwarts School of Witchcraft and Wizardry. The three friends, Harry, Ron and Hermione, are soon immersed in the daily round of Potions, Herbology, Charms, Defence Against the DarkArts and Quidditch. Then mysterious and scary things start happening. First Harry hears strange voices, and then Ron''s sister, Ginny, disappears ...</p>');
