INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('4e0fd1c9-c66b-42e3-8c93-63fc4c9bc172', '9782075090414', N'Harry Potter, Tome 5, Harry Potter et l''ordre du Phénix', '2022', N'Gallimard-jeunesse', N'French', '576', 'https://covers.openlibrary.org/b/id/13323683-L.jpg', N'<p>L''Ordre du Phénix s''est réuni dans la splendeur décrépie de la demeure ancestrale de Sirius Black pour préparer une guerre imminente. Tandis que Lord Voldemort devient de plus en plus puissant, ses pensées envahissent les nuits de Harry, dévoilant son obsession pour la magie redoutable abritée au coeur du Département des mystères. À Poudlard, secrets et dangers sont partout, et chaque détail de la vie des élèves est scruté par Dolores Ombrage, la Grande Inquisitrice nommée par le ministère de la Magie pour espionner Dumbledore et son célèbre protégé. Mais de jeunes sorciers courageux décident alors de former l''Armée de Dumbledore, déterminés à saboter le travail du professeur Ombrage et à acquérir toute la magie dont ils auront besoin pour affronter les forces du Mal.</p><p>Luna, Tonks et autres personnages emblématiques de la saga, scènes cultes sous la garde de l''Ordre du Phénix : une édition illustrée à couper le souffle pour la cinquième année de Harry à Poudlard.</p>');
