INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [image_url], [description]) VALUES ('57763f09-cfb3-4996-96a3-0f18ffafb5b9', '9781411489103', N'Harry Potter and the Chamber of Secrets (SparkNotes Literature Guide)', '2007', N'Sterling Publishing Co., Inc.', N'English', 'https://openlibrary.org/images/icons/avatar_book.png', N'');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('9d50386a-293c-42cb-a270-131ae979a3aa', '9781526618269', N'Harry Potter and the Half-Blood Prince - Ravenclaw Edition', '2021', N'Bloomsbury Publishing Plc', N'English', '560', 'https://covers.openlibrary.org/b/id/12997552-L.jpg', N'<p>This Ravenclaw House Edition of Harry Potter and the Half-Blood Prince celebrates the noble character of the Hogwarts house famed for its wit, learning and wisdom. Harry''s sixth year at Hogwarts is packed with more great Ravenclaw moments and characters - not least Luna Lovegood''s debut Quidditch commentary.</p><p>Each Ravenclaw House Edition features vibrant sprayed edges and intricate bronze foiling. The stunning cover design has a cameo-style portrait of the Half-Blood Prince as the central icon, framed by beautiful house-themed iconography. In addition to a bespoke introduction, the Ravenclaw Edition also contains new illustrations by Kate Greenaway Medal winner Levi Pinfold, including a portrait of inimitable Ravenclaw student Luna Lovegood, and a wonderful image of Gilderoy Lockhart signing copies of Magical Me to accompany a feature on magical books. All seven books in the series will be issued in these highly collectable, beautifully crafted House Editions, designed to be treasured and read for years to come.</p>');
