INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('5ba2cb1a-e4a4-4559-8ec7-a2cb9a852db7', '3551588880', N'Ein plötzlicher Todesfall', '2012', N'Carlsen', N'German', '574', 'https://covers.openlibrary.org/b/id/12960728-L.jpg', N'<p>Ein großer Roman über eine kleine Stadt. Als Barry Fairbrother mit Anfang 40 plötzlich stirbt, sind die Einwohner von Pagford geschockt. Auf den ersten Blick ist die englische Kleinstadt mit ihrem hübschen Marktplatz und der alten Kirche ein verträumtes und friedliches Idyll. Doch hinter der malerischen Fassade liegt die Stadt im Krieg. Krieg zwischen arm und reich, zwischen Kindern und ihren Eltern, zwischen Frauen und ihren Ehemännern, zwischen Lehrern und Schülern. Und dass Barrys Sitz im Gemeinderat nun frei wird, schafft den Nährboden für den größten Krieg, den die Stadt je erlebt hat.</p>');
