INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('319aa8fc-4d4c-4f67-a20d-f28384c64ceb', '2070549720', N'Harry Potter', '2002', N'Distribooks', N'French', '1899', 'https://covers.openlibrary.org/b/id/969535-L.jpg', N'<p>Young wizard-in-training Harry Potter has had his hands full during his first four years at Hogwarts School of Witchcraft and Wizardry. As if excelling on and off the Quidditch field isn''t enough, Harry has heard evil voices in the walls, saved lives, and fended off convicts. Only time will tell how Harry will manage the certain dangers in store for him over the next few years. The first four titles of J.K. Rowling''s magical, witty, exciting adventures are now available in a gift set, perfect for the legions of children whose big brothers and sisters (and parents) have made off with their copies. These gripping fantasy novels are on the road to becoming classics--don''t wait to collect these lovely hardcover editions, illustrated by the talented Mary GrandPré. Each boxed set includes Harry Potter and the Sorcerer''s Stone, Harry Potter and the Chamber of Secrets, Harry Potter and the Prisoner of Azkaban, and Harry Potter and the Goblet of Fire. (Ages 8 and older) --Emilie Coulter   Review
