INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [number_of_pages], [image_url], [description]) VALUES ('3b82e9e4-9bff-44e8-bcca-fa3ce78f1fb8', '1408856786', N'Harry Potter Box Set', '2014', N'Educa Books', '3872', 'https://covers.openlibrary.org/b/id/9016850-L.jpg', N'<p>The Harry Potter books throw you into an amazing fantasy world of witches and wizards, spells, magical creatures, He-Who-Must-Not-Be-Named, and a school of witchcraft and wizardry called Hogwarts. In this school Harry Potter takes many magical classes, plays Quidditch (the sport where you are on a broomstick scoring goals through hoops, and trying to find the magical snitch.), and defeats Voldemort. When Voldemort comes back at him again and again, Harry realizes that Voldemort is invincible, and there is only one way to kill him. With his lessons with Professor Dumbledore, he discovers Voldemort''s past, who he was before he killed all those people, why he killed all those people (including Harry Potter''s parents), and how he is still alive, but is almost a creature, with snake eyes, and slits for nostrils. This best-selling series is astonishing and breathtaking and will change your life forever, just by reading it.</p>');
