INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('84a7e1a9-9d02-48d8-914f-375f1559a6b5', '0132350882', N'Clean code', '2008', N'Prentice Hall', N'English', '431', 'https://covers.openlibrary.org/b/id/5547794-L.jpg', N'<p>4ème de couverture</p><p>Si un code sale peut fonctionner, il peut également compromettre la pérennité d''une entreprise de développement de logiciels. Chaque année, du temps et des ressources sont gaspillés à cause d''un code mal écrit. Toutefois, ce n''est pas une fatalité.</p><p>Grâce à cet ouvrage, vous apprendrez à rédiger du bon code, ainsi qu''à le nettoyer « à la volée », et vous obtiendrez des applications plus robustes, plus évolutives et donc plus durables. Concret et pédagogique, ce manuel se base sur les bonnes pratiques d''une équipe de développeurs aguerris réunie autour de Robert C. Martin, expert logiciel reconnu. Il vous inculquera les valeurs d''un artisan du logiciel et fera de vous un meilleur programmeur.</p><p>Coder proprement est décomposé en trois parties. La première décrit les principes, les motifs et les pratiques employés dans l''écriture d''un code propre. La deuxième est constituée de plusieurs études de cas à la complexité croissante. Chacune d''elles est un exercice de nettoyage: vous partirez d''un exemple de code présentant certains problèmes, et l''auteur vous expliquera comment en obtenir une version saine et performante. La troisième partie, enfin, sera votre récompense. Son unique chapitre contient une liste d''indicateurs éprouvés par l''auteur qui vous seront précieux pour repérer efficacement les défauts de votre code.</p><p>Après avoir lu ce livre, vous saurez :</p><p>- faire la différence entre du bon et du mauvais code ;</p><p>- écrire du bon code et transformer le mauvais code en bon code ;</p><p>- choisir des noms, des fonctions, des objets et des classes appropriés ;</p><p>- mettre en forme le code pour une lisibilité maximale ;</p><p>- implémenter le traitement des erreurs sans perturber la logique du code ;</p><p>- mener des tests unitaires et pratiquer le développement piloté par les tests.</p><p>Véritable manuel du savoir-faire en développement agile, cet ouvrage est un outil indispensable à tout développeur, ingénieur logiciel, chef de projet, responsable d''équipe ou analyste des systèmes dont l''objectif est de produire un meilleur code.</p>');
INSERT INTO [books] ([id], [isbn], title, [publisher], [language], [description]) VALUES ('3391c018-0f7e-4b66-b5a8-4eba18e87545', '9780132928472', N'Robert C. Martin Clean Code Collection (Collection)', N'Pearson Education, Limited', N'English', N'');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('39d7b844-ef61-403e-80f7-52c645416cc4', '9787115291578', N'程序员的职业素养', '2012', N'人民邮电出版社', N'Chinese', '178', 'https://covers.openlibrary.org/b/id/14322941-L.jpg', N'<p>本书是编程大师 Bob 大叔 40 余年编程生涯的心得体会, 讲解成为真正专业的程序员需要什么样的态度、原则，需要采取什么样的行动。作者以自己以及身边的同事走过的弯路、犯过的错误为例，意在为后来人引路，助其职业生涯迈上更高台阶。</p><p>本书适合所有程序员，也可供所有想成为具备职业素养的职场人士参考。</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('dc0c55ac-b22a-44e4-92ee-93eca4c1d41d', '0131857258', N'Agile Principles, Patterns, and Practices in C# (Robert C. Martin Series)', '2006', N'Prentice Hall PTR', N'English', '768', 'https://covers.openlibrary.org/b/id/88620-L.jpg', N'<p>This is the eBook version of the printed book.With the award-winning book Agile Software Development: Principles, Patterns, and Practices, Robert C. Martin helped bring Agile principles to tens of thousands of Java and C++ programmers. Now .NET programmers have a definitive guide to agile methods with this completely updated volume from Robert C. Martin and Micah Martin, Agile Principles, Patterns, and Practices in C#.This book presents a series of case studies illustrating the fundamentals of Agile development and Agile design, and moves quickly from UML models to real C# code. The introductory chapters lay out the basics of the agile movement, while the later chapters show proven techniques in action. The book includes many source code examples that are also available for download from the authors’ Web site.Readers will come away from this book understandingAgile principles, and the fourteen practices of Extreme ProgrammingSpiking, splitting, velocity, and planning iterations and releasesTest-driven development, test-first design, and acceptance testingRefactoring with unit testingPair programmingAgile design and design smellsThe five types of UML diagrams and how to use them effectivelyObject-oriented package design and design patternsHow to put all of it together for a real-world projectWhether you are a C# programmer or a Visual Basic or Java programmer learning C#, a software development manager, or a business analyst, Agile Principles, Patterns, and Practices in C# is the first book you should read to understand agile software and how it applies to programming in the .NET Framework.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('66f729af-10e4-4c7f-8a5d-57913528707a', '0137081073', N'The Clean Coder', '2011', N'Prentice Hall', N'English', '210', 'https://covers.openlibrary.org/b/id/11311437-L.jpg', N'<p>In the Clean Coder: A Code of Conduct for Professional Programmers, legendary software expert Robert C Martin introduces the disciplines, techniques, tools, and practices of true software craftsmanship.</p>');
