INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('7a371466-5194-4bef-b66a-9c1921ce84cb', '0321193679', N'Professional software development', '2004', N'Addison-Wesley', N'English', '243', 'https://covers.openlibrary.org/b/id/192842-L.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('1cb11bce-47c2-4730-bafd-1b3974a9669d', '0735619670', N'Code complete', '2004', N'Microsoft Press', N'English', '914', 'https://covers.openlibrary.org/b/id/8629368-L.jpg', N'<p>Take a strategic approach to software construction—and produce superior products—with this fully updated edition of Steve McConnell''s critically praised and award-winning guide to software development best practices. Widely considered one of the best practical guides to programming, Steve McConnell''s original CODE COMPLETE has been helping developers write better software for more than a decade. Now this classic book has been fully updated and revised with leading-edge practices—and hundreds of new code samples—illustrating the art and science of software construction. Capturing the body of knowledge available from research, academia, and everyday commercial practice, McConnell synthesizes the most effective techniques and must-know principles into clear, pragmatic guidance. No matter what your experience level, development environment, or project size, this book will inform and stimulate your thinking—and help you build the highest quality code.Discover the timeless techniques and strategies that help you:Design for minimum complexity and maximum creativityReap the benefits of collaborative developmentApply defensive programming techniques to reduce and flush out errorsExploit opportunities to refactor—or evolve—code, and do it safelyUse construction practices that are right-weight for your projectDebug problems quickly and effectivelyResolve critical construction issues early and correctlyBuild quality into the beginning, middle, and end of your project</p>');
