INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [number_of_pages], [image_url]) VALUES ('391d46af-4a85-4be7-a8c4-8f045b4f5a77', '0358310326', N'How to Eat', '2020', N'HMH Audio', '256', 'https://covers.openlibrary.org/b/id/10675251-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [number_of_pages], [image_url]) VALUES ('8524f432-9af3-4f69-ab41-275b61bed3bc', '0385344767', N'Dinner for Everyone : 100 Iconic Dishes Made 3 Ways--Easy, Vegan, or Perfect for Company', '2019', N'Clarkson Potter', '432', 'https://covers.openlibrary.org/b/id/8808692-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [description]) VALUES ('a87a11cf-d240-443e-b954-f989caae4835', '0143129716', N'The reducetarian solution', '2017', N'TarcherPerigee', N'English', '302', N'<p>"Brian Kateman coined the term ''Reducetarian--a person who is deliberately reducing his or her consumption of meat--and a global movement was born. In this book, Kateman, the founder of the Reducetarian Foundation, presents more than 70 original essays from influential thinkers on how the simple act of cutting 10% or more of the meat from one''s diet can transform the life of the reader, animals, and the planet. This book features contributions from such luminaries as Seth Godin, Joel Fuhrman, Victoria Moran, Jeffrey Sachs, Bill McKibben, Naomi Oreskes, Peter Singer, and others. With over 40 vegan, vegetarian, and ''less meat'' recipes from bestselling cookbook author Pat Crocker, as well as tons of practical tips for reducing the meat in your diet (for example, skip eating meat with dinner if you ate it with lunch; replace your favorite egg omelet with a tofu scramble; choose a veggie burrito instead of a beef burrito; declare a meatless day of the week), The Reducetarian Solution is a life--not to mention planet!--saving book"--</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages]) VALUES ('7f1dab65-9ca3-4b36-8494-ddafb3aea646', '5389113179', N'Kulinarnai︠a︡ matrit︠s︡a', '2016', N'Russian', '303');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages], [image_url], [description]) VALUES ('a0ae9e03-9a14-4e85-9604-ca27930566d3', '0470526882', N'How to bake everything', '2016', N'English', '703', 'https://covers.openlibrary.org/b/id/13099911-M.jpg', N'<p>In the most comprehensive book of its kind, Mark Bittman offers the ultimate baker''s resource. Finally, here is the simplest way to bake everything, from American favorites (Crunchy Toffee Cookies, Baked Alaska) to of-the-moment updates (Gingerbread Whoopie Pies). It explores global baking, too: Nordic ruis, New Orleans beignets, Afghan snowshoe naan. The recipes satisfy every flavor craving thanks to more than 2,000 recipes and variations: a pound cake can incorporate polenta, yogurt, ricotta, citrus, hazelnuts, ginger, and more. New bakers will appreciate Bittman''s opinionated advice on essential equipment and ingredient substitutions, plus extensive technique illustrations. The pros will find their creativity unleashed with guidance on how to adapt recipes to become vegan, incorporate new grains, improvise tarts, or create customized icebox cakes using a mix-and-match chart. Demystified, deconstructed, and debunked --baking is simpler and more flexible than you ever imagined.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages], [image_url], [description]) VALUES ('92ed4c0e-8229-47f8-a231-f45786fed4e4', '0804188017', N'Mark Bittman''s kitchen matrix', '2015', N'English', '304', 'https://covers.openlibrary.org/b/id/12680673-M.jpg', N'<p>"Bestselling author Mark Bittman anthologizes his popular Matrix series in a boldly graphic new cookbook that emphasizes creativity, improvisation, and simplicity as the keys to varied cooking. Mark Bittman''s Kitchen Matrix is a collection of Bittman''s Matrix pieces, the most popular feature of his "Eat" column for the New York Times Magazine. Each matrix presents one ingredient or technique served up 12 ways, showing how a simple alteration of a basic recipe can yield wildly different results"--</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages], [image_url], [description]) VALUES ('cfeb7b1d-84a1-4ce8-8840-49907311038b', '0804186545', N'A bone to pick', '2015', N'English', '256', 'https://covers.openlibrary.org/b/id/10576493-M.jpg', N'<p>"Mark Bittman made headlines three years ago when it was revealed that, for the first time, the New York Times opinion page would feature a food writer to help us make sense of the tangled webs of food, health, environment, politics, and culture. As an opinion columnist, Mark has delighted us, enraged us, and inspired us to do more for ourselves and our world with the same no-nonsense style. In the tradition of his NYT bestselling Food Matters, this book collects the best of his columns, updated to reflect the latest research, and tied together with new material to give context and show how far we''ve come in just a few years. What emerges is a collection that shows us the story of who we are as a nation of cooks, eaters, and voters right now"--</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('2182c51b-abdc-4e5c-ba27-a95feb517973', '0385344821', N'The VB6 cookbook', '2014', N'Clarkson Potter/Publishers', N'English', '272', 'https://covers.openlibrary.org/b/id/12180410-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('afa651af-2833-4dca-95d5-828272d43a78', '1118093879', N'Leafy greens', '2012', N'Wiley', N'English', '197', 'https://covers.openlibrary.org/b/id/8685957-M.jpg', N'<p>Addressing the need for flavorful, antioxidant-rich foods, a collection of recipes highlights thirty leafy green vegetables that complement such suggestions as crispy-skin salmon on a bed of gingery kale and hot and sour bok choi.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('1f272041-0924-4416-a546-c3bcc1688186', '1118455649', N'How to cook everything vegetarian', '2017', N'Houghton Mifflin Harcourt', N'English', '830', 'https://covers.openlibrary.org/b/id/14476597-M.jpg', N'<p>A definitive, one-stop vegetarian cookbook showcases more than two thousand different recipes and variations for simple meatless meals, including salads, soups, eggs and dairy, vegetables and fruit, pasta, grains, legumes, tofu and other meat substitutes.</p>');
