INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('26e8d051-a739-4515-a082-2c28c3c42a6e', '0767906721', N'The best recipes in the world', '2005', N'Broadway Books', N'English', '757', 'https://covers.openlibrary.org/b/id/9747032-M.jpg', N'<p>The author of How to Cook Everything takes you on the culinary trip of a lifetime. Mark Bittman traveled the world to find and bring back the best recipes of home cooks from 44 countries. This bountiful collection of new, easy, and ultra-flavorful dishes will add exciting new tastes and cosmopolitan flair to your everyday cooking and entertaining.With his million-copy bestseller How to Cook Everything, Mark Bittman made the difficult doable. Now he makes the exotic accessible.In this highly ambitious, accomplished, globe-spanning work, Bittman gathers the best recipes that people from dozens of countries around the world cook every day. And when he brings his distinctive no-frills approach to dishes that were once considered esoteric, America''s home cooks will eagerly follow where they once feared to tread.In more than a thousand recipes, Bittman compellingly demonstrates that there are many places besides Italy and France to which cooks can turn for inspiration. In addition to these favorites, he covers Spain, Portugal, Greece, Russia, Scandinavia, the Balkans, Germany, and other European destinations, giving us easy ways to make dishes like Spanish Mushroom and Chicken Paella, Greek Roast Leg of Lamb with Thyme and Orange, Russian Borscht, and Swedish Appletorte. Asian food now rivals European cuisine''s popularity, and this book reflects that: It''s the first to emphasize European and Asian cuisines equally, with easy-to-follow recipes for favorites like Vietnamese Stir-Fried Vegetables with Nam Pla, Pad Thai, Japanese Salmon Teriyaki, Chinese Black Bean and Garlic Spareribs, and Indian Tandoori Chicken. Nor is the rest of the world ignored: there are hundreds of recipes from North Africa, the Middle East, and Central and South America, too. All will be hits with home cooks looking to add exciting new tastes and cosmopolitan flair to their everyday repertoire. Shop locally, cook globally--Mark Bittman makes it so easy:- Hundreds of recipes that can be made ahead or prepared in under 30 minutes- Informative sidebars and instructional drawings explain unfamiliar techniques and ingredients- Fifty-two international menus, an extensive International Pantry section, and much more make this an essential addition to any cook''s shelfThe Best Recipes in the World is destined to be a classic that will change the way Americans think about everyday food. It''s simply like no other cookbook in the world.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('b1337e4f-4220-4407-9f00-f5ab6c860a85', '0025107755', N'Fish', '1994', N'Macmillan Pub.', N'English', '367', 'https://covers.openlibrary.org/b/id/14872-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('7184a292-ed9e-4bd5-b634-9fec112ffd9b', '0028610105', N'How to cook everything', '1998', N'Macmilllan', N'English', '944', 'https://covers.openlibrary.org/b/id/15968-M.jpg', N'<p>From Wikipedia: How To Cook Everything (John Wiley & Sons, 1998, ISBN 0-02-861010-5) is a general cooking reference written by New York Times food writer Mark Bittman and aimed at United States home cooks. It is the flagship volume of a series of books that include several narrow-subject books about matters such as convenience cooking and vegetarian cuisine, as well as a second volume, How To Cook Everything: Vegetarian, published in 2007, and a second edition with a reduced emphasis on professional techniques in October 2008.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('b65cc926-b9e4-46b4-bfb4-80ef31252fd5', '0767903609', N'Simple to Spectacular', '2000', N'Broadway', N'English', '432', 'https://covers.openlibrary.org/b/id/527663-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language]) VALUES ('db83af33-a3f3-4263-b8c1-67daa794cec8', '9781439120231', N'The food matters cookbook', '2010', N'Simon & Schuster', N'English');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('dde41ef3-8204-4ff1-9401-f926df9ca90e', '0767903617', N'The minimalist cooks at home', '1999', N'Broadway Books', N'English', '248', 'https://covers.openlibrary.org/b/id/6796131-M.jpg', N'<p>Presents dozens of delectable and accessible recipes, all of which utilize a few choice ingredients and simple preparation, for a wide range of tasty but sophisticated dishes, including 10-Minute Stir-Fried Chicken with Nuts, The Minimalist''s Choucroute, and Paella, Fast and Easy.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [image_url], [description]) VALUES ('51822733-3713-4858-bcf1-6fc972d355ab', '9780470528068', N'How to cook everything', '2012', N'Wiley', N'English', 'https://covers.openlibrary.org/b/id/11355783-M.jpg', N'<p>"The next best thing to having Mark Bittman in the kitchen with youMark Bittman''s highly acclaimed, bestselling book How to Cook Everything is an indispensable guide for any modern cook. With How to Cook Everything The Basics he reveals how truly easy it is to learn fundamental techniques and recipes. From dicing vegetables and roasting meat, to cooking building-block meals that include salads, soups, poultry, meats, fish, sides, and desserts, Bittman explains what every home cook, particularly novices, should know.More than 1,000 beautiful and instructive photographs throughout the book reveal key preparation details that make every dish inviting and accessible. With clear and straightforward directions, Bittman''s practical tips and variation ideas, and visual cues that accompany each of the 171 recipes, cooking with The Basics is like having Bittman in the kitchen with you.  This is the essential how-to cookbook, with more than 1,000 beautiful and helpful photos of step-by-step techniques and finished recipes  Special "Basics" pages cover essentials like equipping a kitchen and stocking a pantry, what to look for when buying produce, how to tell when food is done, and more  Tips and variations let home cooks hone their skills and be creative  How to Cook Everything The Basics is an absolutely essential beginner''s cookbook and an irresistible and invaluable guide for accomplished cooks"--</p><p>"A 4-color book with more than 1,000 how-to and finished recipe photos"--</p>');
