INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('d49d1bd1-8ab6-427d-9d9f-762370916e3d', '1594201455', N'In Defense of Food', '2008', N'Penguin Press HC, The', N'English', '256', 'https://covers.openlibrary.org/b/id/12547106-M.jpg', N'<p>What to eat, what not to eat, and how to think about health: a manifesto for our times"Eat food. Not too much. Mostly plants." These simple words go to the heart of Michael Pollan''s In Defense of Food, the well-considered answers he provides to the que</p>');
