INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [number_of_pages], [image_url], [description]) VALUES ('835b46b4-e042-457a-b2d2-fb978a0abd54', '0147514894', N'Pollan on Food Boxed Set', '2014', N'Penguin Books', '1216', 'https://covers.openlibrary.org/b/id/13532629-M.jpg', N'<p>Contains:</p><p><p>Cooked</p><p>In Defense of Food</p><p>Omnivore''s Dilemma</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('a485e9ed-995c-49cf-9d09-aa2496fdfab4', '9578037376', N'Shi wu wu zui', '2009', N'Pin an wen hua you xian gong si', N'Chinese', '302', 'https://covers.openlibrary.org/b/id/13205979-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [description]) VALUES ('27652335-fa46-4bf8-b45f-435c4045be66', '8499923658', N'Cocinar', '2014', N'Debate', N'Spanish', '475', N'<p>In Cooked, Michael Pollan discovers the enduring power of the four classical elements - fire, water, air, and earth - to transform the stuff of nature into delicious things to eat and drink. Apprenticing himself to a succession of culinary masters, Pollan learns how to grill with fire, cook with liquid, bake bread, and ferment everything from cheese to beer - and finds that reclaiming cooking as an act of enjoyment and self-reliance opens the door to a more nourishing life.</p><p>Michael Pollan descubre el poder perdurable de los cuatro elementos clásicos - fuego, agua, aire y tierra - para transformar las cosas de la naturaleza en cosas deliciosas para comer y beber. Aprendiz a sí mismo a una sucesión de maestros de la cocina, Pollan aprende a la parrilla con fuego, cocinar, hornear pan líquido, y fermentar todo, desde queso a la cerveza - y descubre que la recuperación de la cocina como un acto de disfrute y la autosuficiencia abre la puerta a una vida más nutritiva.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [language], [number_of_pages], [description]) VALUES ('dfcaedac-6bac-4089-a87b-a99afb26fca5', '9780525627159', N'How to change your mind', '2018', N'English', '13', N'<p>Presents an investigation into the medical and scientific revolution currently taking place in the field of psychedelic drugs, tracing the criminalization of such substances as LSD and psychedelic mushrooms and how they may offer treatment options for difficult health challenges.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('15c39a06-2be0-47fb-b733-cc962117a2ea', '1881865274', N'Cannabis, forgetting, and the botany of desire', '2002', N'Doreen B. Townsend Center for the Humanities', N'English', '58', 'https://covers.openlibrary.org/b/id/8626389-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('56814533-f3a2-4c5e-adef-fc47a930ecbd', '0747586837', N'The omnivore''s dilemma', '2007', N'Bloomsbury', N'English', '450', 'https://covers.openlibrary.org/b/id/12872766-M.jpg', N'<p>Michael Pollan provides the truth behind why we consume what we consume in the 21st century.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('65dd22b7-00ce-420d-99e5-3c24e39a3b08', '1594204217', N'Cooked', '2013', N'The Penguin Press', N'English', '468', 'https://covers.openlibrary.org/b/id/8322590-M.jpg', N'<p>"Fire, water, air, earth--our most trusted food expert recounts the story of his culinary education In Cooked, Michael Pollan explores the previously uncharted territory of his own kitchen. Here, he discovers the enduring power of the four classical elements--fire, water, air, and earth--to transform the stuff of nature into delicious things to eat and drink. Apprenticing himself to a succession of culinary masters, Pollan learns how to grill with fire, cook with liquid, bake bread, and ferment everything from cheese to beer. In the course of his journey, he discovers that the cook occupies a special place in the world, standing squarely between nature and culture. Both realms are transformed by cooking, and so, in the process, is the cook. Each section of Cooked tracks Pollan''s effort to master a single classic recipe using one of the four elements.^</p><p>A North Carolina barbecue pit master tutors him in the primal magic of fire; a Chez Panisse-trained cook schools him in the art of braising; a celebrated baker teaches him how air transforms grain and water into a fragrant loaf of bread; and finally, several mad-genius "fermentos" (a tribe that includes brewers, cheese makers, and all kinds of picklers) reveal how fungi and bacteria can perform the most amazing alchemies of all. The reader learns alongside Pollan, but the lessons move beyond the practical to become an investigation of how cooking involves us in a web of social and ecological relationships: with plants and animals, the soil, farmers, our history and culture, and, of course, the people our cooking nourishes and delights. Cooking, above all, connects us. The effects of not cooking are similarly far reaching.^</p><p>Relying upon corporations to process our food means we consume huge quantities of fat, sugar, and salt; disrupt an essential link to the natural world; and weaken our relationships with family and friends. In fact, Cooked argues, taking back control of cooking may be the single most important step anyone can take to help make the American food system healthier and more sustainable. Reclaiming cooking as an act of enjoyment and self-reliance, learning to perform the magic of these everyday transformations, opens the door to a more nourishing life. "--</p><p>"In Cooked, Pollan explores the previously uncharted territory of his own kitchen. Here, he discovers the enduring power of the four classical elements--fire, water, air, and earth--to transform the stuff of nature into delicious things to eat and drink. In the course of his journey, he discovers that the cook occupies a special place in the world, standing squarely between nature and culture. Both realms are transformed by cooking, and so, in the process, is the cook"--</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('aac54ac0-a371-4014-9488-8e7d1342f7c2', '9780803735002', N'The omnivore''s dilemma', '2009', N'Dial Books for Young Readers', N'English', '344', 'https://covers.openlibrary.org/b/id/8596719-M.jpg', N'<p>The New York Times bestseller that''s changing America''s diet is now perfect for younger readers"What ''s for dinner?" seemed like a simple question—until journalist and supermarket detective Michael Pollan delved behind the scenes. From fast food and big organic to small farms and old-fashioned hunting and gathering, this young readers'' adaptation of Pollan''s famous food-chain exploration encourages kids to consider the personal and global health implications of their food choices. In a smart, compelling format with updated facts, plenty of photos, graphs, and visuals, as well as a new afterword and backmatter, The Omnivore''s Dilemma serves up a bold message to the generation that needs it most: It''s time to take charge of our national eating habits—and it starts with you.</p>');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('adad3da2-4781-4321-9715-7c605cada7d1', '1594200823', N'The Omnivore''s Dilemma', '2006', N'Penguin Press', N'English', '450', 'https://covers.openlibrary.org/b/id/8596706-M.jpg', N'<p>What should we have for dinner? For omnivore''s like ourselves, this simple question has always posed a dilemma: When you can eat just about anything nature (or the supermarket) has to offer, deciding what you should eat will inevitably stir anxiety, especially when some of the foods on offer might shorten your life. Today, buffeted by one food fad after another, America is suffering from what can only be described as a national eating disorder. The omnivore''s dilemma has returned with a vengeance, as the cornucopia of the modern American supermarket and fast-food outlet confronts us with a bewildering and treacherous food landscape. What''s at stake in our eating choices is not only our own and our children''s health, but the health of the environment that sustains life on earth.</p><p>The Omnivore''s Dilemma is a groundbreaking book in which one of America''s most fascinating, original, and elegant writers turns his own omnivorous mind to the seemingly straightforward question of what we should have for dinner. The question has confronted us since man discovered fire, but, according to Michael Pollan, the bestselling author of The Botany of Desire, how we answer it today, ath the dawn of the twenty-first century, may well determine our very survival as a species. Should we eat a fast-food hamburger? Something organic> Or perhaps something we hunt, gather or grow ourselves?</p><p>To find out, Pollan follows each of the food chains that sustain us--industrial food, organic or alternative food, and food we forage ourselves--from the source to a final meal, and in the process develops a definitive account of the American way of eating. His absorbing narrative takes us from Iowa cornfields to food laboratories, from feedlots and fast-food restaurants to organic farms and hunting grounds, always emphasizing our dynamic coevolutionary relationship with the handful of plant and animal species we depend on. Each time Pollan sits down to a meal, he deploys his unique blend of personal and investigative journalism to trace the origins of everything consumed, revealing what we unwittingly ingest and explaining how our taste for particular foods and flavors reflects our evolutionary inheritance.</p><p>The surprising answers Pollan offers to the simple question posed by this book have profound political, economic, psychological, and even mortal implications for all of us. Ultimately, this is a book as much about visionary solutions as it is about problems, and Pollan contends that, when it comes to food, doing the right thing often turns out to be the tastiest thing an eater can do. Beautifully written and thrillingly argued, The Omnivore''s Dilemma promises to change the way we think about the politics and pleasure of eating. For anyone who reads it, dinner will never again look, or taste, quite the same.</p><p>--jacket</p>');
