INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url]) VALUES ('3346290f-ed60-438a-bcb4-e7db66db3b8d', '0679415327', N'A place of my own', '1997', N'Random House', N'English', '320', 'https://covers.openlibrary.org/b/id/417552-M.jpg');
INSERT INTO [books] ([id], [isbn], title, [published_year], [publisher], [language], [number_of_pages], [image_url], [description]) VALUES ('3dd8bbc4-41bb-4fe1-9224-1299bd1b0ccd', '014311638', N'Food rules', '2009', N'Penguin Books', N'English', '140', 'https://covers.openlibrary.org/b/id/6305235-M.jpg', N'<p>A pocket compendium of food wisdom from the author of The Omnivore''s Dilemma and In Defense of Food, Michael Pollan, our nation''s most trusted resource for food-related issues, offers this indispensible guide for anyone concerned about health and food. Simple, sensible, and easy to use, Food Rules is a set of memorable rules for eating wisely, many drawn from a variety of ethnic or cultural traditions. Whether at the supermarket or an all-you-can-eat-buffet, this handy, pocket-size resource is the perfect guide for anyone who would like to become more mindful of the food we eat.</p>');
